import React from 'react';

interface SearchBarProps {
  placeholder: string;
}

export const SearchBar: React.FC<SearchBarProps> = ({ placeholder }) => {
  return (
    <div className="search-bar">
      <input 
        type="text" 
        placeholder={placeholder}
        className="search-input"
      />
    </div>
  );
};
